const App = () => {
  const now = new Date()
  const a = 10
  const b = 20
  console.log(now, a+b)
  return (
    <div>
      <p>Hello world</p>
      <P>
        {a} + {b} is {a + b}
      </P>
    </div>
  )
}

export default App
